import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "../ExpensesFilter/ExpenseFilter";
import Card from '../UI/Card';
import './Expenses.css';

function Expenses(props) {
    const ExpenseFilterChangeHandler=(Year)=>{
        const year=Year;
        console.log(year);
    };
    return (
        <div>
        <ExpensesFilter onExpenseFilterChange={ExpenseFilterChangeHandler} />
        <Card className="expenses">
            <ExpenseItem
                title={props.data[0].title}
                amnt={props.data[0].amount}
                date={props.data[0].date}
            />
            <ExpenseItem
                title={props.data[1].title}
                amnt={props.data[1].amount}
                date={props.data[1].date}
            />
            <ExpenseItem
                title={props.data[2].title}
                amnt={props.data[2].amount}
                date={props.data[2].date}
            />
            <ExpenseItem
                title={props.data[3].title}
                amnt={props.data[3].amount}
                date={props.data[3].date}
            />
        </Card>
        </div>
    );
}

export default Expenses;
